'use strict'

const blkPreLoader = (function () {
  const style = '@keyframes hidePreloader{0%{opacity:100%}100%{opacity:0%}} .preloader-hide{animation:hidePreloader .5s linear .5s forwards;} '
  const img = 'data:image/gif;base64,'

  const body = document.body

  const loaderStyle = document.createElement('style')
  loaderStyle.textContent = style
  body.appendChild(loaderStyle)

  const loaderContainer = document.createElement('div')
  loaderContainer.setAttribute('class', 'loader')
  loaderContainer.setAttribute('style', 'position: absolute; top:0; left:0; height:100%; width:100%; background-color:rgba(255, 255, 255, 0.75);align-items: center;justify-content: center;display: flex;')
  body.appendChild(loaderContainer)

  const loaderImage = document.createElement('img')
  loaderImage.setAttribute('src', img)
  loaderImage.setAttribute('style', 'width:72px;height:auto;')
  loaderContainer.appendChild(loaderImage)

  window.addEventListener('load', (e) => {
    loaderContainer.setAttribute('class', 'preloader-hide')
    setTimeout(function () {
      loaderContainer.parentElement.removeChild(loaderContainer)
      loaderStyle.parentElement.removeChild(loaderStyle)
    }, 1000)
  })

  return {// public interface

  }
})()
